script: |
  super -f text -I q10705.spq | sort > q10705.out

inputs:
  - name: q10705.spq
    data: |
      SELECT 92 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 43 NOT IN ( - + 45, col0 * - + col1, col0 * - col1, + 97 );
  - name: tab2

outputs:
  - name: q10705.out
    data: |
      92
      92
      92
